/*
** THEME VARIABLES
*/
/* stylelint-disable */
.styleguide {
  position: relative;
  display: flex;
  flex-direction: column;
}
.styleguide a {
  text-decoration: underline;
}
.styleguide-controls {
  position: absolute;
  right: 0.5em;
  top: 0.5em;
  z-index: 100;
}
.styleguide-header {
  padding: 0.75em;
  border-bottom: 1px solid #000000;
}
.styleguide-header h1 {
  font-size: 2em;
  margin: 0 0 .5em 0;
  color: #f9faf9;
}
.styleguide-header p {
  font-size: 1.2em;
}
.styleguide-header p:last-of-type {
  margin-bottom: 0;
}
.styleguide-sections {
  flex: 1;
  overflow: auto;
}
.styleguide-sections > section {
  background-color: #000000;
  padding: 0;
  border-bottom: 1px solid #000000;
  border-top: none;
}
.styleguide-sections > section:last-child {
  margin-bottom: 0;
}
.styleguide-sections > section.collapsed {
  background-color: #000000;
}
.styleguide-sections > section.collapsed > .section-heading {
  display: block;
  margin: 0;
  padding-bottom: 0.75em;
  color: #dfe1e0;
}
.styleguide-sections > section.collapsed > .section-heading:hover {
  color: #f9faf9;
  background-color: #0d0d0d;
}
.styleguide-sections > section.collapsed > .section-heading:active {
  background-color: #000000;
}
.styleguide-sections > section.collapsed > * {
  display: none;
}
.styleguide-sections .section-heading.section-heading {
  padding: 0.75em 0.75em 0 0.75em;
  cursor: pointer;
  font-weight: normal;
  font-size: 1.8em;
  color: #f9faf9;
}
.styleguide-sections section > h2 {
  font-size: 1.5em;
  line-height: 1.2;
  margin: 1em 0.75em 0 0.75em;
  color: #f9faf9;
}
.styleguide-sections section > p {
  font-size: 1.1em;
  margin: 0.5em 0.75em 1em 0.75em;
}
.styleguide .example {
  display: flex;
  flex-wrap: wrap;
  border-radius: 3px;
  padding: 0.25em;
}
.styleguide .example .example-rendered,
.styleguide .example .example-code {
  position: relative;
  flex: 1 1 300px;
  min-width: 0;
  margin: 0.25em;
  border-radius: 3px;
  border: 1px solid #000000;
}
.styleguide .example .example-rendered {
  padding: 0.5em;
  background: #000000;
  overflow: hidden;
}
.styleguide .example .example-code {
  background-color: #000000;
}
.styleguide .example .example-code pre {
  border: none;
  background-color: inherit;
}
